      - 'path::out'
      - ../package-lock.json
      - ../package.json
      - ../node_modules
  proto:
    path: ../proto
  export:
    path: '{path::proto}/**'
  doc:
    path: ../doc
  out.raw.debug:
    criterion:
      debug: debug
      raw: raw
      content: prime
    path: '{path::out}/debug'
  out.compiled.debug:
    criterion:
      debug: debug
      raw: compiled
      content: prime
    path: '{path::out}/compiled.debug'
  out.raw.release:
    criterion:
      debug: release
      raw: raw
      content: prime
    path: '{path::out}/raw.release'
  out.compiled.release:
    criterion:
      debug: release
      raw: compiled
      content: prime
    path: '{path::out}/release'
  entry.proto.no.tests:
    criterion:
      tests: no.tests
    path: ../proto/dwtools/atop/will/MainTop.s
  entry.proto.only.tests:
    criterion:
      tests: only.tests
    path: ../proto/**/*.test.s
  entry.out.raw.debug.debug:
    criterion:
      debug: debug
      raw: raw
      content: prime
    path: '{path::out.*=1}/source/dwtools/atop/will/MainTop.s'
  entry.out.raw.debug.release:
    criterion:
      debug: release
      raw: raw
      content: prime
    path: '{path::out.*=1}/source/dwtools/atop/will/MainTop.s'
  entry.out.compiled.debug.debug:
    criterion:
      debug: debug
      raw: compiled
      content: prime
    path: '{path::out.*=}/source/Index.s'
  entry.out.compiled.debug.release:
    criterion:
      debug: release
      raw: compiled
      content: prime
    path: '{path::out.*=}/source/Index.s'
